day_1 = (b'<!DOCTYPE html>\n<html lang="en-us">\n<head>\n<meta charset="utf-8"/>\n<title>Day 1 - Advent of Code 2023</title>\n<link rel="stylesheet" type="text/css" href="/static/style.css?31"/>\n<link rel="stylesheet alternate" type="text/css" href="/static/highcontrast.css?1" title="High Contrast"/>\n<link rel="shortcut icon" href="/favicon.png"/>\n<script>window.addEventListener(\'click\', function(e,s,r){if(e.target.nodeName===\'CODE\'&&e.detail===3){s=window.getSelection();s.removeAllRanges();r=document.createRange();r.selectNodeContents(e.target);s.addRange(r);}});</script>\n</head><!--\n\n\n\n\nOh, hello!  Funny seeing you here.\n\nI appreciate your enthusiasm, but you aren\'t going to find much down here.\nThere certainly aren\'t clues to any of the puzzles.  The best surprises don\'t\neven appear in the source until you unlock them for real.\n\nPlease be careful with automated requests; I\'m not a massive company, and I can\nonly take so much traffic.  Please be considerate so that everyone gets to play.\n\nIf you\'re curious about how Advent of Code works, it\'s running on some custom\nPerl code. Other than a few integrations (auth, analytics, social media), I\nbuilt the whole thing myself, including the design, animations, prose, and all\nof the puzzles.\n\nThe puzzles are most of the work; preparing a new calendar and a new set of\npuzzles each year takes all of my free time for 4-5 months. A lot of effort\nwent into building this thing - I hope you\'re enjoying playing it as much as I\nenjoyed making it for you!\n\nIf you\'d like to hang out, I\'m @was.tl on Bluesky, @ericwastl@hachyderm.io on\nMastodon, and @ericwastl on Twitter.\n\n- Eric Wastl\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n-->\n<body>\n<header><div><h1 class="title-global"><a href="/">Advent of Code</a></h1><nav><ul><li><a href="/2023/about">[About]</a></li><li><a href="/2023/events">[Events]</a></li><li><a href="https://teespring.com/stores/advent-of-code" target="_blank">[Shop]</a></li><li><a href="/2023/auth/login">[Log In]</a></li></ul></nav></div><div><h1 class="title-event">&nbsp;&nbsp;&nbsp;<span class="title-event-wrap">sub y{</span><a href="/2023">2023</a><span class="title-event-wrap">}</span></h1><nav><ul><li><a href="/2023">[Calendar]</a></li><li><a href="/2023/support">[AoC++]</a></li><li><a href="/2023/sponsors">[Sponsors]</a></li><li><a href="/2023/leaderboard">[Leaderboard]</a></li><li><a href="/2023/stats">[Stats]</a></li></ul></nav></div></header>\n\n<div id="sidebar">\n<div id="sponsor"><div class="quiet">Our <a href="/2023/sponsors">sponsors</a> help make Advent of Code possible:</div><div class="sponsor"><a href="/2023/sponsors/redirect?url=https%3A%2F%2Fdeveloper%2Eansys%2Ecom%2F" target="_blank" onclick="if(ga)ga(\'send\',\'event\',\'sponsor\',\'sidebar\',this.href);" rel="noopener">Ansys</a> - Make this holiday season unforgettable with Ansys. Join the Ansys developer community, search jobs, and SHINE in your favorite language.</div></div>\n</div><!--/sidebar-->\n\n'
         b'<main>\n<article class="day-desc"><h2>--- Day 1: Trebuchet?! ---</h2>'
         b'<p>Something is wrong with global snow production, and you\'ve been selected to take a look. The Elves have even given you a map; on it, they\'ve used stars to mark the top fifty locations that are likely to be having problems.</p>\n<p>You\'ve been doing this long enough to know that to restore snow operations, you need to check all <em class="star">fifty stars</em> by December 25th.</p>\n<p>Collect stars by solving puzzles.  Two puzzles will be made available on each day in the Advent calendar; the second puzzle is unlocked when you complete the first.  Each puzzle grants <em class="star">one star</em>. Good luck!</p>\n<p>You try to ask why they can\'t just use a <a href="/2015/day/1">weather machine</a> ("not powerful enough") and where they\'re even sending you ("the sky") and why your map looks mostly blank ("you sure ask a lot of questions") <span title="My hope is that this abomination of a run-on sentence somehow conveys the chaos of being hastily loaded into a trebuchet.">and</span> hang on did you just say the sky ("of course, where do you think snow comes from") when you realize that the Elves are already loading you into a <a href="https://en.wikipedia.org/wiki/Trebuchet" target="_blank">trebuchet</a> ("please hold still, we need to strap you in").</p>\n<p>As they\'re making the final adjustments, they discover that their calibration document (your puzzle input) has been <em>amended</em> by a very young Elf who was apparently just excited to show off her art skills. Consequently, the Elves are having trouble reading the values on the document.</p>\n<p>The newly-improved calibration document consists of lines of text; each line originally contained a specific <em>calibration value</em> that the Elves now need to recover. On each line, the calibration value can be found by combining the <em>first digit</em> and the <em>last digit</em> (in that order) to form a single <em>two-digit number</em>.</p>\n<p>For example:</p>\n<pre><code>1abc2\npqr3stu8vwx\na1b2c3d4e5f\ntreb7uchet\n</code></pre>\n<p>In this example, the calibration values of these four lines are <code>12</code>, <code>38</code>, <code>15</code>, and <code>77</code>. Adding these together produces <code><em>142</em></code>.</p>\n<p>Consider your entire calibration document. <em>What is the sum of all of the calibration values?</em></p>\n</article>\n<p>To play, please identify yourself via one of these services:</p>\n<p><a href="/auth/github">[GitHub]</a> <a href="/auth/google">[Google]</a> <a href="/auth/twitter">[Twitter]</a> <a href="/auth/reddit">[Reddit]</a> <span class="quiet">- <a href="/about#faq_auth">[How Does Auth Work?]</a></span></p>\n</main>\n\n<!-- ga -->\n<script>\n(function(i,s,o,g,r,a,m){i[\'GoogleAnalyticsObject\']=r;i[r]=i[r]||function(){\n(i[r].q=i[r].q||[]).push(arguments)},i[r].l=1*new Date();a=s.createElement(o),\nm=s.getElementsByTagName(o)[0];a.async=1;a.src=g;m.parentNode.insertBefore(a,m)\n})(window,document,\'script\',\'//www.google-analytics.com/analytics.js\',\'ga\');\nga(\'create\', \'UA-69522494-1\', \'auto\');\nga(\'set\', \'anonymizeIp\', true);\nga(\'send\', \'pageview\');\n</script>\n<!-- /ga -->\n</body>\n</html>')


